import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
  grid: {
    height: "100vh",
    width: "100vw",
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    background: "white",
  },
  sidebar: {
    height: "100vh",
    width: "15%",
    transition: "width .3s ease-in-out",
  },
  smallSidebar: {
    width: "5%",
    transition: "width .2s ease-in",
  },
  mainContent: {
    width: "85%",
    transition: "all 0.2s ease-out",
  },
  bigMainContent: {
    width: "95%",
    transition: "all .1s ease-out,transform 0.8s linear",
  },
}));
